typedef struct {
    TokenType type;
    const char* lexema;
    int length;
} Token;

typedef struct { int destino; char simbolo; } Transicion;

typedef struct {
    int id; int num_transiciones; Transicion transiciones[128];
    int final; TokenType tipo;
} EstadoDFA;

int match_dfa(EstadoDFA* estados, int cantidad, const char* input) {
    int estado = 0, len = 0, ultimo_final = -1;
    for (int i = 0; input[i]; i++) {
        int trans_found = 0;
        for (int j = 0; j < estados[estado].num_transiciones; j++) {
            if (estados[estado].transiciones[j].simbolo == input[i]) {
                estado = estados[estado].transiciones[j].destino;
                trans_found = 1; break; } }
        if (!trans_found) break;
        len++;
        if (estados[estado].final) ultimo_final = len;
    }
    return ultimo_final;
}

